import React from 'react';

const Nav = () => {
    return (
        <div className='nav'>
            <ul>
                <li><button onClick= '#'>Home</button></li>
                <li><button onClick= '#'>Gallery</button></li>
                <li><button onClick= '#'>Store</button></li>
                <li><button onClick= '#'>Contact Us</button></li>
            </ul>
        </div>
    );
}

export default Nav;
